#carousel-container {
  width: 100%;
  height: 100vh;
  display: flex;
  flex-direction: row; }

#background-0 {
  background-image: url("ca568694d30adcf191db3be3fd24a400.png");
  background-size: 100% 100%;
  width: 100%;
  margin: 0 auto;
  color: #f3f3f3;
  transition: width 2s ease-in-out, color 2s ease-in-out;
  /* filter: grayscale(100%); */ }

#text-box-0 h1 {
  font-family: "Great Vibes", cursive;
  font-size: 8vw;
  transition: font-size 1.5s ease-in-out, transform 1.5s ease-in-out;
  -webkit-text-fill-color: transparent;
  color: white;
  /* transition: linear-gradient 2s; */ }

.text-box {
  text-align: center;
  padding-top: 32vh;
  font-family: "El Messiri", sans-serif; }

.text-box p {
  font-size: 2.5vw;
  text-align: center; }

.button {
  background-color: transparent;
  top: 40%;
  border: 0px;
  font-size: 10vw;
  transform: scale(0.5, 1);
  outline: none; }

.button:hover {
  color: #4b4646; }

.next-image-carousel {
  position: absolute;
  left: 90%; }

.previous-image-carousel {
  position: absolute;
  left: 10%; }

* {
  margin: 0;
  padding: 0; }
